package com.example.stresstest.benchmark;public interface IBenchmark {    void initialize();    void initialize(Long size);    /**     * Prepares the benchmark.     */    void warmup();    /**     * Run the default benchmark. Some benchmarks need to take parameters in order to run.     */    void run();    /**     * Stops the benchmark and all processes associated with it.     */    void stop();    /**     * Free resources.     */    void clean();    /**     * Does the actual computation.     */    void compute();}